<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8" />
    <title>sprite88</title>
</head>
<body>
<canvas id="sprite88" width="36" height="42" style="border:2px solid #cccccc;"></canvas>
<script src=".\sprite88\jaf.js"></script>
<script>
ST('sprite88', function(_f) {
    _f.setFps(25);
    _f.defaults.debug = false;
    _f.loop = true;
    // Create sprite: sprite85
    var sprite85 = new movieclip('sprite85', 1, true);
    var l0 = sprite85.layer('l0', 0);
    l0.frameclip('t0', 0, 0, 1)
    .shape('shape84', './sprite88/shape84.svg', 'svg', 0, 0, 1, 0)
    .track('mx')
    .key(0, [1, 0, 0, 1, 0, 0]);


    // Create sprite: sprite87
    var sprite87 = new movieclip('sprite87', 1, true);
    var l0 = sprite87.layer('l0', 0);
    l0.frameclip('t0', 0, 0, 1)
    .shape('shape86', './sprite88/shape86.svg', 'svg', 0, 0, 1, 0)
    .track('mx')
    .key(0, [1, 0, 0, 1, 0, 0]);

    var l1 = sprite87.layer('l1', 1);
    l1.frameclip('t0', 0, 0, 1)
    .sprite('sprite85', sprite85)
    .track('mx')
    .key(0, [0.999985, 1.52588e-005, 0, 0.999985, -6, -1]);


    // Create sprite: mm
    var mm = new movieclip('mm', 1, true);
    var l0 = mm.layer('l0', 0);
    l0.frameclip('t0', 0, 0, 1)
    .shape('shape83', './sprite88/shape83.svg', 'svg', 0, 0, 1, 0)
    .track('mx')
    .key(0, [1, 0, 0, 1, 18, 21]);

    var l1 = mm.layer('l1', 1);
    l1.frameclip('t0', 0, 0, 1)
    .sprite('sprite87', sprite87)
    .track('mx')
    .key(0, [0.99852, 0, 0, 1, 25, 21]);

    var l2 = mm.layer('l2', 2);
    l2.frameclip('t0', 0, 0, 1)
    .sprite('sprite87', sprite87)
    .track('mx')
    .key(0, [-0.99852, 0, 0, -1, 11, 21]);

    var l3 = mm.layer('l3', 3);


    _f.mc(mm);
    _f.start();
});
</script>
</body>
</html>
